import React from 'react';

class ContactUs extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      latitude: null,
      longitude: null,
      error: null,
    };
  }

  componentDidMount() {
    this.getLocation();
  }

  getLocation() {
    if (navigator.geolocation) {
      navigator.geolocation.getCurrentPosition(
        (position) => {
          this.setState({
            latitude: position.coords.latitude,
            longitude: position.coords.longitude,
          });
        },
        (error) => {
          this.setState({ error: error.message });
        }
      );
    } else {
      this.setState({ error: "Geolocation is not supported by this browser." });
    }
  }

  render() {
    return (
      <div className="container-fluid bg-light" style={{ minHeight: "100vh" }}>
        <nav  style={{ backgroundColor:"#FAC9FF",width:"1420px",height:"70px"}}>
          <div className="container" >
            <center><a className="navbar-brand" href="#" style={{fontSize:"50px"}}>Contact Us</a></center>
          </div>
        </nav>
        <div   style={{backgroundColor:"#C8B5FF",width:"1420px",height:"635px"}} >
          <h1>Daily Wage Worker Information</h1>
          <div>
            <h2>Phone Numbers:</h2>
            <ul>
              <li>+1 123-456-7890</li>
              <li>+1 234-567-8901</li>
              <li>+1 345-678-9012</li>
              <li>+1 456-789-0123</li>
            </ul>
          </div>
          <div>
            <h2>Addresses:</h2>
            <ul>
              <li>123 Main Street, City, Country</li>
              <li>456 Elm Street, City, Country</li>
              <li>789 Oak Street, City, Country</li>
              <li>012 Pine Street, City, Country</li>
            </ul>
          </div>
          <div>
            <h2>Current Location:</h2>
            {this.state.latitude && this.state.longitude ? (
              <p>Latitude: {this.state.latitude}, Longitude: {this.state.longitude}</p>
            ) : (
              <p>{this.state.error || "Fetching location..."}</p>
            )}
          </div>
        </div>
      </div>
    );
  }
}

export default ContactUs;
